    function debouncer(fn, timeout) {
        var timeoutID , timeout = timeout || 200;
        return function () {
            var scope = this , args = arguments;
            clearTimeout( timeoutID );
            timeoutID = setTimeout( function () {
                fn.apply( scope , Array.prototype.slice.call( args ) );
            } , timeout );
        }
    } 

